import "./ExpenseItem.css";
import Controller from '../Controller';
import ExpenseDate  from "./ExpenseDate";
function ExpenseItem(props) {

  return (
    <tr className="expense-item">
      <td>{props.date}</td>
      <section className="expense-item__description">
        <td><h2>Temperature: {props.temperature}</h2></td>
        <td><h2>Humidity: {props.humidity}</h2></td>
        <td><h2>Water: {props.water}</h2></td>
        <td className="expense-item__price">{props.id}</td>
      </section>
    </tr>
  );
}
export default ExpenseItem;
